import os
import uuid
from datetime import datetime
from typing import Dict, List, Optional, Tuple
import re
import csv

# File Validation
class FileValidator:
    def __init__(self):
        self.allowed_extensions = {'.csv', '.json', '.xlsx', '.txt'}
        self.error_messages = {
            1001: "Invalid file extension",
            1002: "File size exceeds limit",
            1003: "File contains invalid characters"
        }

    def validate_extension(self, filename: str) -> Tuple[bool, Optional[str]]:
        _, ext = os.path.splitext(filename)
        if ext.lower() not in self.allowed_extensions:
            return False, self.error_messages[1001]
        return True, None

    def set_custom_error_message(self, error_code: int, message: str):
        self.error_messages[error_code] = message

# DUNS Validation
class DUNSValidator:
    @staticmethod
    def validate_duns(duns: str, action_type: str, date: datetime) -> bool:
        if not duns or len(duns) != 9 or not duns.isdigit():
            return False

        if action_type == 'create' and date < datetime.now():
            return False

        return True

# File Management
class FilePublisher:
    def __init__(self):
        self.published_files = set()

    def generate_file_id(self) -> str:
        return str(uuid.uuid4())

    def is_duplicate(self, file_hash: str) -> bool:
        return file_hash in self.published_files

    def track_published_file(self, file_hash: str):
        self.published_files.add(file_hash)

# FPDS Data Processing
class FPDSService:
    def load_historical_data(self, file_path: str) -> List[Dict]:
        data = []
        with open(file_path, 'r') as f:
            reader = csv.DictReader(f)
            for row in reader:
                data.append(dict(row))
        return data

    def merge_with_current(self, historical: List[Dict], current: List[Dict]) -> List[Dict]:
        return historical + current

# FABS Processing
class FABSProcessor:
    def derive_frec_fields(self, record: Dict) -> Dict:
        record['frec_code'] = record.get('agency_code', '')[:3]
        record['frec_description'] = f"FREC-{record['frec_code']}"
        return record

    def validate_headers(self, file_path: str, required_headers: List[str]) -> bool:
        with open(file_path, 'r') as f:
            reader = csv.reader(f)
            headers = next(reader)
            return all(header in headers for header in required_headers)

    def format_f_file(self, record: Dict) -> Dict:
        formatted = {}
        for k, v in record.items():
            formatted[k.upper()] = str(v).strip()
        return formatted

# Data Quality
class DataQualityService:
    def derive_funding_agency(self, record: Dict) -> Dict:
        record['funding_agency_code'] = record.get('agency_code', '000')
        return record

    def process_deletions(self, date: datetime, records: List[Dict]) -> List[Dict]:
        return [r for r in records if r.get('active', True) or r.get('modified_date', datetime.now()) > date]

